FormattingHTML formattingIn some cases you might want to rendered your translation as an HTML message and not a static string.const messages = {
  en: {
    message: {
      hello: 'hello  world'
    }
  }
}
Template the following for Vue 1 (notice the triple brackets):{{{ $t('message.hello') }}}
Or for Vue 2 (triple brackets are deprecated in vue 2.0 and replaced by v-html):
Output the following (instead of the message pre formatted)hello
 exists but is rendered as html and not a string-->
world
Named formattingLocale messages the following:const messages = {
  en: {
    message: {
      hello: '{msg} world'
    }
  }
}
Template the following:{{ $t('message.hello', { msg: 'hello' }) }}
Output the following:hello world
List formattingLocale messages the following:const messages = {
  en: {
    message: {
      hello: '{0} world'
    }
  }
}
Template the following:{{ $t('message.hello', ['hello']) }}
Output the following:hello world
Support ruby on rails i18n formatLocale messages the following:const messages = {
  en: {
    message: {
      hello: '%{msg} world'
    }
  }
}
Template the following:{{ $t('message.hello', { msg: 'hello' }) }}
Output the following:hello world
Custom formattingSometimes, you maybe need to translate with custom formatting (e.g. ICU message syntax).You can realize with custom formatter that implement Formatter Interface.The below custom formatter with ES2015 class syntax:// Custom Fromatter implementaion
class CustomFormatter {
 constructor (options) {
   // ...
 }

 format (message, ...values) {
   // implement formatting logic here
   // ...

   // return the resolved message string
   return 'resolved message string'
 }
}

// register with `formatter` option
const i18n = new VueI18n({
  locale: 'en-US',
  formatter: new CustomFormatter(/* here the constructor options */),
  messages: {
    'en-US': {
      // ...
    },
    // ...
  }
})

// Run!
new Vue({ i18n }).$mount('#app')
You can check the custom formatter official example.

pluralization.html.body:
PluralizationYou can translate with pluralization.  You must define the locale that have a pipe | separator, and define plurals in pipe separator.Locale messages the following:const messages = {
  en: {
    car: 'car | cars'
  }
}
Template the following:{{ $tc('car', 1) }}
{{ $tc('car', 2) }}
Output the following:car
cars

syntax.html.body:
Locale Messages SyntaxLocale Messages syntax the bellow:// As Flowtype defnition, Locale Messages syntax like BNF annotation
type LocaleMessages = { [key: Locale]: LocaleMessageObject };
type LocaleMessageObject = { [key: Path]: LocaleMessage };
type LocaleMessageArray = LocaleMessage[];
type LocaleMessage = string | LocaleMessageObject | LocaleMessageArray;
type Locale = string;
type Path = string;
Based on the above syntax, You can configure the bellow structure Locale Messages:{
  "en": {  // 'en' Locale
    "key1": "this is message1", // basic
    "nested": { // nested
      "message1": "this is nested message1"
    },
    errors: [ // array
      "this is 0 error code message",
      {  // array in object
         "internal1": "this is internal 1 error message"
      },
      [  // array in array
         "this is nested array error 1"
      ]
    ]
  },
  "ja": { // 'ja' Locale
    // ...
  }
}
In the above Locale Messages structure,  You can translate with using below key paths.

  {{ $t('key1') }}

  {{ $t('nested.message1') }}

  {{ $t('errors[0]') }}

  {{ $t('errors[1].internal1') }}

  {{ $t('errors[2][0]') }}

Ouput the following:

  this is message1

  this is nested message1

  this is 0 error code message

  this is internal 1 error message

  this is nested array error 1

