Fallback translationThe following locale messages that not exist message key in ja locale:const messages = {
  en: {
    message: 'hello world'
  },
  ja: {
  }
}
When specify the fallbackLocale option to VueI18n constructor option, message key is traslated with en locale key:const i18n = new VueI18n({
  locale: 'ja',
  fallbackLocale: 'en',
  messages
})
Template the following:{{ $t('message') }}
Output the following:hello world

component.html.body:
Component Based TranslationIn general, Locale info (e.g. locale,messages, etc) is set as constructor option of VueI18n instance, and it set  i18n option as root Vue instance. Thereby you globally can translate with using $t or $tc in the root Vue instance are composed some component. you manage  locale info for each component and it translate, it was better is convenient due to Vue is component oriented.The below component based translation example:// setup locale info for root Vue instance
const i18n = new VueI18n({
  locale: 'ja',
  messages: {
    en: {
      message: {
        hello: 'hello world',
        greeting: 'good morning'
      }
    },
    ja: {
      message: {
        hello: 'こんにちは、世界',
        greeting: 'おはようございます'
      }
    }
  }
})

// Define component
const Component1 = {
  template: `

     Component1 locale messages: {{ $t("message.hello") }}
     Fallback global locale messages: {{ $t("message.greeting") }}
   `,
  i18n: { // `i18n` option
    messages: {
      en: { message: { hello: 'hello component1' } },
      ja: { message: { hello: 'こんにちは、component1' } }
    }
  }
}

new Vue({
  i18n,
  components: {
    Component1
  }
}).$mount('#app')
Template the following:
  {{ $t("message.hello") }}


Output the following:
  こんにちは、世界

    Component1 locale messages: こんにちは、component1
    Fallback global locale messages: おはよう、世界！


As in the example above, if the component doesn't have the locale message, it  fallbacks and translates global locale message. Also translate it using global locale (in the above example, locale: 'ja').If you hope translate in the component locale, you can realize with sync: false and locale in i18n option.

linked.html.body:
Linked TranslationIf there's a translation key that will always have the same concrete text as another one you can just link to it. To link to another translation key, all you have to do is to prefix its contents with an @: sign followed by the full name of the translation key including the namespace you want to link to.Locale messages the following:const messages = {
  en: {
    message: {
      the_world: 'the world',
      dio: 'DIO:',
      linked: '@:message.dio @:message.the_world !!!!'
    }
  }
}
Template the following:{{ $t('message.linked') }}
Output the following:DIO: the world !!!!

