Dynamic Locale removedIf you need to dynamic set locale messages, you should implement the below:  const i18n = new VueI18n({ locale: 'en' })
  const app = new Vue({
    i18n,
    data: { loading: '' }
  }).$mount('#app')

  function loadLocaleMessage (locale, cb) {
    return fetch('/locales/' + locale, {
      method: 'get',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      }
    }).then((res) => {
      return res.json()
    }).then((json) => {
      if (Object.keys(json).length === 0) {
        return Promise.reject(new Error('locale empty !!'))
      } else {
        return Promise.resolve(json)
      }
    }).then((message) => {
      cb(null, message)
    }).catch((error) => {
      cb(error)
    })
  }

  app.loading = 'loading ...'
  loadLocaleMessage('en', (err, message) => {
    if (err) {
      app.loading = ''
      console.error(err)
      return
    }
    i18n.setLocaleMessage('en', message)
    app.loading = ''
  })
